uint32_t swap_endian(uint32_t &val)
{
	val = ((val << 8) & 0xFF00FF00) | ((val >> 8) & 0x00FF00FF);
	return (val << 16) | (val >> 16);
}

uint8_t* read_images(const char* filename)
{
	fstream input(filename, ios::in | ios::binary);

	input.seekg(4, ios::cur);
	uint32_t size = 0;
	input.read((char*)(&size), 4);
	size = swap_endian(size);
	input.seekg(8, ios::cur);

	uint8_t* data = new uint8_t[size * 28 * 28];
	input.read((char*)data, size * 28 * 28);
	input.close();

	return data;
}
uint8_t* read_labels(const char* filename)
{
	fstream input(filename, ios::in | ios::binary);

	input.seekg(4, ios::cur);
	uint32_t size = 0;
	input.read((char*)(&size), 4);
	size = swap_endian(size);

	uint8_t* data = new uint8_t[size];
	input.read((char*)data, size);
	input.close();

	return data;
}

